import { Button, Col, Row } from 'react-bootstrap';
import React from 'react';
import '../App.css';

export default function Welcome() {
  return (
   <Col lg="4" className='pt-2 pb-2 mb-5  text-center rounded segundoColor'>

        <div className=''>

        <p className='text-dark h5 d-inline me-4'>Bienvenido Gabriel{sessionStorage.getItem('Username')}</p>
        </div>
        <Button  variant='danger' className='text-center rounded-pill mb-1 mt-1'>Out</Button>



   </Col>
  )
}
